import React from "react";
import {withSnackbar} from "notistack";
import {withRouter} from "react-router-dom";
import {withStyles} from "@material-ui/core/styles";
import {Container, Toolbar, Typography, Button} from "@material-ui/core";


const styles = theme => ({
    mainContainer: {
        flexGrow: 1,
        padding: theme.spacing(3),
    },
    appBarSpacer: theme.mixins.toolbar,
    mainContent: {
        marginTop: theme.spacing(2),
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
    },
    toolbar: {
        width: '100%',
    },
});

class Verify extends React.Component {
    componentDidMount() {
        this.props.enqueueSnackbar("Labeling Work", {
            variant: 'info'
        });
    }

    render() {
        const { classes } = this.props;

        return (
            <Container component="main" className={classes.mainContainer}>
                <React.Fragment>
                    <Typography className={classes.successTitle}>회원 가입 신청 완료</Typography>
                    <Typography className={classes.successHeader2}>가입이 완료 되려면 관리자의 승인이 필요합니다.</Typography>
                    <Typography className={classes.successBody}>승인 후에 Kfashion의 서비스를<br/> 이용하실 수 있습니다.</Typography>
                </React.Fragment>
            </Container>
        );
    }
};

export default withSnackbar(withRouter(withStyles(styles) (Verify)));
